import React from 'react';
import './CardItem.css';
import ItemListContainer from './ItemListContainer.js';
import './home.css';


function Home(){
    return(
        <div className="home-section center container-fluid">        
            <div className="row">
                <div className="col-1"></div>
                <div className="col-4">
                    </div><ItemListContainer title="Desarrolla nuevas habilidades para lograr la tan ansiada sensación este es mi año"/>
                <div className="row justify-content-center pb-4 "></div>
            </div>
        </div>
    );
}

export default Home;
